// Special cases of returning zero, infinity, NaN as binary FP
// Take parameters for the sign, and for NaN the significand

fn return_binary32_zero(s: i32) -> f32 {
    return_binary32(s, 0,0 )
}

fn return_binary32_inf(s: i32) -> f32 {
    return_binary32(s,255,0)
}

fn return_binary32_nan(s: i32, c_hi: u64, c_lo: u64) -> f32 {
    return_binary32(s, 255, (c_hi >> 42) + (1u64 << 22))
}

